import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: 1,
      title: "car insurance",
      amount: "293.67",
      date: new Date(2021, 2, 28)    
    },
    {
      title: "Coffee",
      amount: "2",
      date: new Date(2021, 2, 28)    
    },
    {
      title: "gift",
      amount: "87",
      date: new Date(2021, 2, 28)

    },
  ]
  return (
    <div>
      <ExpenseItem title={expenses.title} amount={expenses.amount} date={expenses.date}></ExpenseItem>
    </div>
  );
}

export default App;
